import { Component } from '@angular/core';

@Component({
  selector: 'app-loading',
  templateUrl: './loading.component.html',
  styleUrls: ['./loading.component.css'],
  standalone: true
})
export class LoadingComponent {
}
<div class="loading">
  <img src="../../../assets/loading.svg" alt="Loading..." />
</div>
